import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            //dark lime
            dark: '#397367',
            light: '#63CCCA',
            main: '#42858C',
        },
        secondary: {
            main: '#5DA399',
            light:'#FFFFFF',
            dark: '#35393C',
        },
    },
});
